import React from "react";

const NavLinks = () => {

  const navItems = ["The Team", "Match Centre","Tickets & Membership", "News", "Merchandise", "Community"];
  const navList = navItems.map((nav,index) => <li key={index}>{nav}</li>);

  return (
    <div>
      <ul>{navList}</ul>
    </div>
    );
};

export default Navigation;
